import React from 'react';

const About = () => {
  return (
    <div className="container mx-auto pt-10 px-10 lg:w-6/12 lg:pt-28">
      <h1 className="tracking-widest text-2xl text-gray-700 font-black pt-5">
        About Me
      </h1>
      <p className="text-1xl text-gray-500 pt-4">
        I am a certified Full-Stack Web Developer and current Computer Science
        student at the University of Arizona. If I were to describe myself in
        one word, it would be resourceful. Where there is a will there is a way
        and that is what I always keep in mind when coding. I always try to
        think outside the box and find creative ways to solve problems. If you
        asked me what keeps me motivated to continuously learn, I would say
        challenge all the way. I do the thing that scares me the most, proudly
        and patiently. What I love about coding is that it keeps me on my toes.
        It is a combination of frustration, happiness, uncharted territory, an
        amalgam of information and so much more. I would not have it any other
        way.
      </p>
    </div>
  );
};

export default About;
